import Select from "react-select";
import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { BsArrowLeft } from "react-icons/bs";
import { AboutProfileInput } from "../Profile/components/AboutProfile";
import { useState } from "react";

export const AddAsset = () => {
  const [ColorPicker, setColorPicker] = useState(true);
  const ColorPickerOpen = () => {
    setColorPicker(!ColorPicker);
  };
  return (
    <>
      <div className="custom_container">
        {ColorPicker ? <PageTop title="Add Asset" /> : <PageTop title="" />}
        <div className="row">
          <div className="col-8">
            <div className="profile_iner_cont">
              {ColorPicker ? <AddAssetForm /> : <PageTop />}
            </div>
          </div>
          <div className="col-4">
            <button onClick={ColorPickerOpen}>jfnv</button>
          </div>
        </div>
      </div>
    </>
  );
};
const PageTop = (props) => {
  return (
    <>
      <div>
        <div className="row TotalOpenings_input_main_div ">
          <div className="col-12">
            <TopPageTitle
              TitleLink={-1}
              TilelIcon={<BsArrowLeft />}
              Name={props.title}
            />
          </div>
        </div>
      </div>
    </>
  );
};
const AddAssetForm = () => {
  const options = [
    { value: "degital", label: "degital" },
    { value: "flowers", label: "flowers" },
  ];
  return (
    <>
      <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
        <div className="col-12">
          <div className="dashboard_top_week_Select">
            <label className="all_page_my_label">Type of Asset</label>
            <Select options={options} placeholder="Please pick a type" />
          </div>
        </div>
        <div className="col-6">
          <AboutProfileInput
            label="Asset Name"
            type="text"
            className="form-control"
            placeholder="Whatâ€™s assets"
          />
        </div>
      </div>
    </>
  );
};
